$(document).ready(function(){
	AOS.init({disable:"mobile"})
}),$(".datepicker").each(function(){
	new Pikaday({field:this})
});

$('.nav-link').click(function() {
    var sectionTo = $(this).attr('href');
    $('html, body').animate({
      scrollTop: $(sectionTo).offset().top
    }, 1500);
});